import React, {useState} from 'react'
import {GoogleMap, withScriptjs, withGoogleMap, Marker, InfoWindow} from "react-google-maps"
import locationData from "../locationData.js"
import Nav from "./Nav"
import Man from "../assets/man-doing-crossfit.jpg"
import styled from "styled-components"

const Wrapper = styled.div`
  h1 {
    text-align: center;
    margin: 1em;
  }
  h1,
  h3,
  p {
    font-family: "Poppins", sans-serif;
    color: #e2ded3;
  }

  .deets {
    color: #33363b !important;
  }
  .info {
    width: 50%;
  }
  .flex {
    display: flex;
  }
  .locations {
    display: flex;
    justify-content: space-around;
  }
  .man {
    max-height: 106%;
    width: 100%;
    position: absolute;
    top: 0;
    z-index: -2;
  }
  .filter {
    height: 106%;
    width: 100%;
    position: absolute;
    top: 0;
    left: 0;
    opacity: calc(28 / 100);
    background: #403f3f;
    z-index: -1;
  }
  .info {
    height: 100%;
  }
`;

function Map() {

    const [selectedLocation, setSelectedLocation] = useState(null)

    return (
      <div>
        <GoogleMap
          defaultZoom={10}
          defaultCenter={{ lat: 39.748859, lng: -104.99752 }}
        >
          {locationData.map((loc) => (
            <Marker
              key={loc.id}
              position={{
                lat: loc.lat,
                lng: loc.lng,
              }}
              onClick={() => {
                setSelectedLocation(loc);
              }}
            />
          ))}
          {selectedLocation && (
            <InfoWindow
              position={{
                lat: selectedLocation.lat,
                lng: selectedLocation.lng,
              }}
              onCloseClick={() => setSelectedLocation(null)}
            >
              <div>

                <p>{selectedLocation.address}</p>
                <p>
                  {selectedLocation.city}. {selectedLocation.zip}
                </p>

                <p>720-555-5555</p>
                <a href={selectedLocation.direction}>Directions</a>
              </div>
            </InfoWindow>
          )}
        </GoogleMap>
      </div>
    );
}

const WrappedMap = withScriptjs(withGoogleMap(Map))

export default function Contact(){
    return (
      <Wrapper>
        <Nav />
        <img className="man" src={Man} alt="" />
        <div className="filter"></div>
        <div className="flex">
          <div className="info">
            <h1>Locations</h1>
            <div className="locations">
              <div className="loc">
                <h3 className="deets">Crossfit Attix 1</h3>
                <p className="deets">1150 Larimer St.</p>
                <p className="deets">Denver CO. 80202</p>
                <p className="deets">720-555-5555</p>
              </div>
              <div className="loc">
                <h3 className="deets">Crossfit Attix 2</h3>
                <p className="deets">6834 S University Blvd</p>
                <p className="deets">Centennial CO. 80012</p>
                <p className="deets">720-555-5555</p>
              </div>
              <div className="loc">
                <h3 className="deets">Crossfit Attix 3</h3>
                <p className="deets">6525 Gunpark Dr Ste. 370</p>
                <p className="deets">Boulder CO. 80301</p>
                <p className="deets">720-555-5555</p>
              </div>
            </div>
          </div>
          <div style={{ width: "50vw", height: "100vh" }}>
            <WrappedMap
              googleMapURL={`https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=AIzaSyC9JB8ol62HnhEKe6V1kNBSMao5UbmzV-o`}
              loadingElement={<div style={{ height: "100%" }} />}
              containerElement={<div style={{ height: "100%" }} />}
              mapElement={<div style={{ height: "100%" }} />}
            />
          </div>
        </div>
      </Wrapper>
    );
}
